import './App.css';
import {Route, Routes} from "react-router-dom";
import {CalendarMain} from "./webapp/calendar/component/calendar.main";

const App = () => {
  return (
    <>
      <Routes>
          <Route path="/" element={<CalendarMain/>} />
      </Routes>
    </>
  );
}

export default App;
